{"13": ["Удивлён количеству плохих отзывов.... нормальный модулятор...", "2021-04-23T08:43:08Z", "", "0", 1, 0, 5, "FM трансмиттер блютуз FM модулятор с пультом", "NeoMobile"], "15": ["Не работает блютуз, остальное не проверяла.. так как покупался для блютуз... ", "2021-04-16T15:44:35Z", "", "0", 1, 0, 2, "FM трансмиттер блютуз FM модулятор с пультом", "NeoMobile"], "24": ["Полная ерунда!!!деньги на ветер.Не работает блутуз,аукс,задаю вопросы сюда-полный эгнор уже неделю.создала заявку о возврате-тоже самое!!!валбериз меня,конечно,расстроил!", "2021-03-24T20:06:06Z", "", "0", 1, 0, 1, "FM трансмиттер блютуз FM модулятор с пультом", "NeoMobile"], "26": ["Пришел во время, но с флешки не читает, не из одного гнезда из двух! Видимо скидка не просто так, а из-за дефекта! Писали бы сразу не кондиция! Было бы ясно! Возврат делать не буду, не больше деньги 340 руб.!", "2021-03-18T11:35:55Z", "", "0", 0, 1, 1, "FM трансмиттер блютуз FM модулятор с пультом", "NeoMobile"], "32": ["Устройство не работает.При включении только шипение и оно гаснет.", "2021-02-19T07:03:23Z", "", "0", 2, 0, 1, "FM трансмиттер блютуз FM модулятор с пультом", "NeoMobile"], "33": ["Товар пришёл без пульта,упаковка вскрыта,цвет заказывали синий пришёл белый.Однозначно будет возврат!!!", "2021-02-18T12:17:08Z", "", "0", 1, 0, 1, "FM трансмиттер блютуз FM модулятор с пультом", "NeoMobile"], "36": ["Пришел в помятой упаковке. Упаковка была перемотанна  скотчем. Модулятор работает, но он  пришёл без пульта!!", "2021-02-08T16:17:57Z", "", "0", 1, 0, 2, "FM трансмиттер блютуз FM модулятор с пультом", "NeoMobile"], "40": ["Пришёл не комплектный (нет аудио кабеля и инструкции), упаковка вскрывалась уже до меня. По работе: не читает карту памяти 128 гиг, с магнитолой по радиоканалу соединяется, пульт работает в 50 см, не дальше, блютуз не проверял, возвращаю.", "2021-01-29T11:54:55Z", "", "0", 1, 0, 3, "FM трансмиттер блютуз FM модулятор с пультом", "NeoMobile"], "41": ["Царапаный инструкции нету упаковка вскрыта и заклеена скотчем после теста в машине могц сказать что шипит ужасно качество звуеа отвратительное не кгму не советую данный магазин", "2021-01-27T13:00:37Z", "", "0", 3, 0, 1, "FM трансмиттер блютуз FM модулятор с пультом", "NeoMobile"], "42": ["Модулятор пришёл с вскрытой упаковкой и без пульта. Пришлось сделать возврат, но на свой страх и риск заказал опять.", "2021-01-26T08:23:39Z", "", "0", 1, 0, 1, "FM трансмиттер блютуз FM модулятор с пультом", "NeoMobile"]}
